// Generated by BUCKLESCRIPT, PLEASE EDIT WITH CARE
'use strict';


function randomId(param) {
  var number = Math.random().toString();
  var time = Date.now().toString();
  return ("I" + (time + number)).replace(".", "-");
}

exports.randomId = randomId;
/* No side effect */
